import React from 'react';
import { Button, makeStyles, createStyles } from '@material-ui/core';
import './styles.css';

const useStyles = makeStyles(() =>
  createStyles({
    myButton: {
      composes: 'myButton',
    },
  })
);

const MyButton = () => {
  const classes = useStyles();

  return (
    <Button className={classes.myButton}>
      Click me!
    </Button>
  );
};

export default MyButton;
